@feliciathegoat is back with another limited-edition rework of the iconic Chuck 70 silhouette—this time refreshing his infamous flame print with a new color combo from the @golfwang palette 🔥

The vibrant pattern has been a staple in Tyler, The Creator’s collections for years, perfectly capturing his irreverent style. This new design recreates the striking contrast of the original with a distinct neutral canvas and pink flames. Bright blue accents call back to the OG print, and pink pinstripes pop off the midsole. 

🗣 Available now on Converse.com.
